(8, 4, 'c89dc0c902', '1', 'text', '{\"wid_name\":\"text\",\"wid_id\":\"c89dc0c902\",\"editor_js\":\"{\\\"time\\\":1683628585966,\\\"blocks\\\":[{\\\"type\\\":\\\"paragraph\\\",\\\"data\\\":{\\\"text\\\":\\\"Welcome to our music sharing\\\\\\/streaming\\\\\\/selling platform! By using our platform, you agree to the following terms of usage:\\\"}},{\\\"type\\\":\\\"header\\\",\\\"data\\\":{\\\"text\\\":\\\"1. Use of the Platform\\\",\\\"level\\\":2}},{\\\"type\\\":\\\"paragraph\\\",\\\"data\\\":{\\\"text\\\":\\\"Our platform is designed to allow users to share, stream, and sell music. You may only use our platform for lawful purposes and in compliance with all applicable laws and regulations.\\\"}},{\\\"type\\\":\\\"header\\\",\\\"data\\\":{\\\"text\\\":\\\"2. User Accounts\\\",\\\"level\\\":2}},{\\\"type\\\":\\\"paragraph\\\",\\\"data\\\":{\\\"text\\\":\\\"To use our platform, you must create a user account. You are responsible for maintaining the confidentiality of your account credentials and for all activities that occur under your account.\\\"}},{\\\"type\\\":\\\"header\\\",\\\"data\\\":{\\\"text\\\":\\\"3. Content\\\",\\\"level\\\":2}},{\\\"type\\\":\\\"paragraph\\\",\\\"data\\\":{\\\"text\\\":\\\"You are solely responsible for the content that you share, stream, or sell on our platform. You represent and warrant that you have all necessary rights to the content and that the content does not infringe on the intellectual property rights of any third party.\\\"}},{\\\"type\\\":\\\"header\\\",\\\"data\\\":{\\\"text\\\":\\\"4. Prohibited Activities\\\",\\\"level\\\":2}},{\\\"type\\\":\\\"paragraph\\\",\\\"data\\\":{\\\"text\\\":\\\"You may not use our platform to engage in any of the following activities:\\\"}},{\\\"type\\\":\\\"list\\\",\\\"data\\\":{\\\"style\\\":\\\"ordered\\\",\\\"items\\\":[\\\"Violating any laws or regulations\\\",\\\"Infringing on the intellectual property rights of any third party\\\",\\\"Uploading or sharing content that is illegal, offensive, or harmful\\\",\\\"Interfering with the proper functioning of the platform\\\",\\\"Attempting to gain unauthorized access to the platform or to other users\' accounts\\\"]}},{\\\"type\\\":\\\"header\\\",\\\"data\\\":{\\\"text\\\":\\\"5. Payment\\\",\\\"level\\\":2}},{\\\"type\\\":\\\"paragraph\\\",\\\"data\\\":{\\\"text\\\":\\\"If you sell music on our platform, you will receive payment for your sales in accordance with our payment policies. We reserve the right to withhold payment for any sales that violate our terms of usage.\\\"}},{\\\"type\\\":\\\"header\\\",\\\"data\\\":{\\\"text\\\":\\\"6. Termination\\\",\\\"level\\\":2}},{\\\"type\\\":\\\"paragraph\\\",\\\"data\\\":{\\\"text\\\":\\\"We may terminate your user account and\\\\\\/or access to our platform at any time and for any reason, without notice.\\\"}},{\\\"type\\\":\\\"header\\\",\\\"data\\\":{\\\"text\\\":\\\"7. Changes to the Terms\\\",\\\"level\\\":2}},{\\\"type\\\":\\\"paragraph\\\",\\\"data\\\":{\\\"text\\\":\\\"We reserve the right to modify these terms of usage at any time. Your continued use of our platform after any such modifications constitutes your acceptance of the updated terms\\\"}}],\\\"version\\\":\\\"2.26.5\\\",\\\"html\\\":\\\"<div class=\'editorjs_html_wrapper\'><p>Welcome to our music sharing\\\\\\/streaming\\\\\\/selling platform! By using our platform, you agree to the following terms of usage:<\\\\\\/p><h2>1. Use of the Platform<\\\\\\/h2><p>Our platform is designed to allow users to share, stream, and sell music. You may only use our platform for lawful purposes and in compliance with all applicable laws and regulations.<\\\\\\/p><h2>2. User Accounts<\\\\\\/h2><p>To use our platform, you must create a user account. You are responsible for maintaining the confidentiality of your account credentials and for all activities that occur under your account.<\\\\\\/p><h2>3. Content<\\\\\\/h2><p>You are solely responsible for the content that you share, stream, or sell on our platform. You represent and warrant that you have all necessary rights to the content and that the content does not infringe on the intellectual property rights of any third party.<\\\\\\/p><h2>4. Prohibited Activities<\\\\\\/h2><p>You may not use our platform to engage in any of the following activities:<\\\\\\/p><ol><li>Violating any laws or regulations<\\\\\\/li><li>Infringing on the intellectual property rights of any third party<\\\\\\/li><li>Uploading or sharing content that is illegal, offensive, or harmful<\\\\\\/li><li>Interfering with the proper functioning of the platform<\\\\\\/li><li>Attempting to gain unauthorized access to the platform or to other users\' accounts<\\\\\\/li><\\\\\\/ol><h2>5. Payment<\\\\\\/h2><p>If you sell music on our platform, you will receive payment for your sales in accordance with our payment policies. We reserve the right to withhold payment for any sales that violate our terms of usage.<\\\\\\/p><h2>6. Termination<\\\\\\/h2><p>We may terminate your user account and\\\\\\/or access to our platform at any time and for any reason, without notice.<\\\\\\/p><h2>7. Changes to the Terms<\\\\\\/h2><p>We reserve the right to modify these terms of usage at any time. Your continued use of our platform after any such modifications constitutes your acceptance of the updated terms<\\\\\\/p><\\\\\\/div>\\\",\\\"files\\\":{\\\"images\\\":[],\\\"videos\\\":[]}}\"}', NULL, NULL, NULL, '2023-12-06 02:09:15'),
